import React, { Component } from 'react';
import logo from '../logo.png';
import Nbar from './Nbar.js';
import Web3 from 'web3'

class App extends Component {


  async componentWillMount() {
    await this.loadWeb3()
    await this.loadBlockchainData()
  }
  render() {
    return (
      <div className="Home">
        <Nbar/>
      </div>
    );
  }
}

export default App;
